#define HPS_TIMER0_BASE 0xFFC08000
#define HPS_TIMER1_BASE 0xFFC09000
#define HPS_TIMER2_BASE 0xFFD00000
#define HPS_TIMER3_BASE 0xFFD01000
#define FPGA_BRIDGE 0xFFD0501C

/* ARM A9 MPCORE devices */
#define PERIPH_BASE 0xFFFEC000       // base address of peripheral devices
#define MPCORE_PRIV_TIMER 0xFFFEC600 // PERIPH_BASE + 0x0600

/* Interrupt controller (GIC) CPU interface(s) */
#define MPCORE_GIC_CPUIF 0xFFFEC100 // PERIPH_BASE + 0x100
#define ICCICR 0x00                 // offset to CPU interface control reg
#define ICCPMR 0x04                 // offset to interrupt priority mask reg
#define ICCIAR 0x0C                 // offset to interrupt acknowledge reg
#define ICCEOIR 0x10                // offset to end of interrupt reg
/* Interrupt controller (GIC) distributor interface(s) */
#define MPCORE_GIC_DIST 0xFFFED000 // PERIPH_BASE + 0x1000
#define ICDDCR 0x00                // offset to distributor control reg
#define ICDISER 0x100              // offset to interrupt set-enable regs
#define ICDICER 0x180              // offset to interrupt clear-enable regs
#define ICDIPTR 0x800              // offset to interrupt processor targets regs
#define ICDICFR 0xC00              // offset to interrupt configuration regs

// debugging
#define RLEDs ((volatile long *)0xFF200000)

// constants
// Screen size
#define RESOLUTION_X 320
#define RESOLUTION_Y 240

// player boundaries
#define X_BOUND 320 // 320 - 9 - 9 so model does not go out of bounds
#define Y_BOUND 240 // 240 - 9 - 9 so model does not go out of bounds

// PS/2 Scan Codes
#define W_PRESS 0x1D
#define A_PRESS 0x1C
#define S_PRESS 0x1B
#define D_PRESS 0x23
#define I_PRESS 0x43
#define EMPTY_PRESS 0xF0

// boundary codes
#define EMPTY_CODE 0
#define PLAYER_CODE 1
#define PROJECTILE_CODE 2
#define ZOMBIE_CODE 3
#define BARRELL_CODE 4

// direction codes
#define UP_CODE 0
#define DOWN_CODE 1
#define LEFT_CODE 2
#define RIGHT_CODE 3

