void intialize_player(struct player *p) {
    p->x = X_BOUND / 2;
    p->prev_x = player1.x;
    p->prev2_x = player1.x;
    p->y = Y_BOUND / 2;
    p->prev_y = player1.y;
    p->prev2_y = player1.y;
    p->direction = 1;
    p->health = 100;
    p->isAlive = true;
    p->invincible = false;
}

void initialize_proj(struct projectile *p) {
    p->x = 0;
    p->y = 0;
    p->prev_x = 0;
    p->prev_y = 0;
    p->prev2_x = 0;
    p->prev_y = 0;
    p->direction = 0;
    p->isActive = false;
    p->speed = BASE_PROJECTILE_SPEED;
}

void initialize_healthbar(struct health *h) {
    h->x = X_BOUND / 2;
    h->y = Y_BOUND / 2 ;
    h->prev_x = h->x;
    h->prev_y = h->y;
    h->prev2_x = h->x;
    h->prev2_y = h->y;
}

void initialize_game() {
    int i, j;

    // reset global variables to default values 
    num_zombies = 0;
    zombie_buffer = 0;
    update_zombie = true;
    num_barrells = 0;
    barrell_buffer = 0;
    num_points = 0;
    invincibility_counter = 0;
    start_text_counter = 0;

    // edit global structs
    intialize_player(&player1);

    initialize_healthbar(&healthBar);
    initialize_healthbar(&green_health);

    for (i = 0; i < MAX_PROJECTILES; i++) {
        struct projectile p = {0, 0, 0, 0, 0, 0, 0, false, BASE_PROJECTILE_SPEED};
        projectiles[i] = p;
    }

    //  initialize zombies
    for (i = 0; i < MAX_ZOMBIES; i++)
    {
        struct zombie z = spawn_zombie(i);
        zombies[i] = z;
    }
    for (i = 0; i < MAX_BARRELLS; i++)
    {
        struct barrell b = spawn_barrell(i);
        barrells[i] = b;
    }
}


