void zombie_movement(int zombie_id, struct player *p)
{
    int r = 15;
    int rem_x, rem_y;
    if (zombies[zombie_id].isAlive && zombies[zombie_id].y >= r && zombies[zombie_id].y <= Y_BOUND - r && zombies[zombie_id].x >= r && zombies[zombie_id].x <= X_BOUND - r)
    {
        int dir_x = (player1.x + 10 * zombie_id - zombies[zombie_id].x);
        int dir_y = (player1.y + 10 * zombie_id - zombies[zombie_id].y);
        rem_x = (zombies[zombie_id].x + (dir_x / abs(dir_x)))%(X_BOUND-r);
        rem_y = (zombies[zombie_id].y + (dir_y / abs(dir_y)))%(Y_BOUND-r);
        if (rem_x > 0) zombies[zombie_id].x = zombies[zombie_id].x + (dir_x / abs(dir_x));
        if (rem_y > 0) zombies[zombie_id].y = zombies[zombie_id].y + (dir_y / abs(dir_y));
        
    }
    if (!p->invincible && ((p->x >= zombies[zombie_id].x - 13) && (p->x <= zombies[zombie_id].x + 13)) && ((p->y >= zombies[zombie_id].y - 13) && (p->y <= zombies[zombie_id].y + 13)))
    {
        // printf("HIT ZOMBIE %d", zombie_id);
        p->health -= 1; // projectile hits zombie and the zombie's health will decrease
        if (p->isAlive && p->health <= 0)
        { // if the zombie has <= 0 health then it is dead
            p->isAlive = false;
            p->invincible = true;
        }
    }
}

