void update_projectile(struct projectile *p, struct player *play)
{
    int i, j, k;
    // update position of an active projectile
    if (p->isActive)
    {
        switch (p->direction)
        {
        case UP_CODE:
            if (p->y > 9)
                p->y = p->y - dy;
            else
                p->isActive = false;
            break;
        case DOWN_CODE:
            if (p->y < Y_BOUND - 9)
                p->y = p->y + dy;
            else
                p->isActive = false;
            break;
        case LEFT_CODE:
            if (p->x > 9)
                p->x = p->x - dx;
            else
                p->isActive = false;
            break;
        case RIGHT_CODE:
            if (p->x < X_BOUND - 9)
                p->x = p->x + dx;
            else
                p->isActive = false;
            break;
        default:
            break;
        }

        // if boundary[x][y] is a int >= 10 then a zombie is in that position
        for (i = 0; i < MAX_ZOMBIES; i++)
        {
            if (zombies[i].isAlive && ((p->x >= zombies[i].x - 7) && (p->x <= zombies[i].x + 7)) && ((p->y >= zombies[i].y - 7) && (p->y <= zombies[i].y + 7)))
            {
                // printf("HIT ZOMBIE %d", zombie_id);
                zombies[i].health -= 1; // projectile hits zombie and the zombie's health will decrease
                if (zombies[i].isAlive && zombies[i].health <= 0)
                { // if the zombie has <= 0 health then it is dead
                    zombies[i].isAlive = false;
                    num_zombies = num_zombies - 1;
                }
                p->isActive = false;
                boundary[p->x][p->y] = EMPTY_CODE;
                num_points += 1;
                break;
            }
        }
        for (j = 0; j < MAX_BARRELLS; j++)
        {
            if (barrells[j].isActive && ((p->x >= barrells[j].x - 7) && (p->x <= barrells[j].x + 7)) && ((p->y >= barrells[j].y - 7) && (p->y <= barrells[j].y + 7)))
            {
                barrells[j].isActive = false;
                num_barrells -= 1;
                for (k = 0; k < MAX_ZOMBIES; k++)
                {
                    if (zombies[k].isAlive && ((barrells[j].x >= zombies[k].x - 60) && (barrells[j].x <= zombies[k].x + 60)) && ((barrells[j].y >= zombies[k].y - 60) && (barrells[j].y <= zombies[k].y + 60)))
                    {
                        zombies[k].isAlive = false;
                        num_zombies = num_zombies - 1;
                        num_points += 1;
                    }
                }

                if (((barrells[j].x >= play->x - 60) && (barrells[j].x <= play->x + 60)) && ((barrells[j].y >= play->y - 60) && (barrells[j].y <= play->y + 60)))
                    play->health -= 10;
                play->invincible = true;
                if (play->health <= 0)
                {
                    play->isAlive = false;
                }

                p->isActive = false;
                break;
            }
            boundary[p->x][p->y] = EMPTY_CODE;
        }
    }
}

